//树遍历
function loopTree(tree, callback, name, parent){
    tree.forEach((t, i) => {
        //t.parent = parent;
        callback(t, i);
        if(t[name]){
            loopTree(t[name], callback, name, t);
        }
    });
}

export function loopTreeForLaunchr(...args){
    return loopTree(...args, 'children');
}

//通过ID定位
export function getPositionByID(tree, id){
    let result;
    loopTreeForLaunchr(tree, (t, i) => {
        if(t.id === id){
            result = tree;
        }
    });
}

function combineSectionPerson(sectionList, personList, callback){
    loopTreeForLaunchr(sectionList, (section, i) => {
        personList.forEach((person, j) => {
            if(person.U_DEPT_ID == section.SHOW_ID){
                callback && callback(person);
                section.children.push(person);
            }
        });
    });
    return sectionList;
}

//平面数据转换成树

/*
 *      const ID = "id",
 *      TEXT = 'text',
 *      PID = 'pid';
 */

export function toTreeData(data, ID, PID, callback, parentSectionID = 0){
    var pos={};
    var tree=[];
    var i=0;
    let dataI;
    let item;
    //let parentSectionID = '';
    while(data.length!=0){

        if(data[i][PID] == parentSectionID){
            dataI = data[i];
            item = {
                id:data[i][ID],
                children:[],
                ...dataI
            };
            callback && (callback(item));
            tree.push(item);

            pos[data[i][ID]]=[tree.length-1];
            data.splice(i,1);
            i--;
        }else{
            var posArr=pos[data[i][PID]];
            if(posArr!=undefined){

                var obj=tree[posArr[0]];
                for(var j=1;j<posArr.length;j++){
                    obj=obj.children[posArr[j]];
                }
                dataI = data[i];
                item = {
                    id:data[i][ID],
                    children:[],
                    ...dataI
                };
                callback && callback(item);

                obj.children.push(item);
                pos[data[i][ID]]=posArr.concat([obj.children.length-1]);
                data.splice(i,1);
                i--;
            }
        }
        i++;
        if(i>data.length-1){
            i=0;
        }
    }
    return tree;
}


