export function getSectionPersionTree(excludedKeys){

    return new Promise((resolve, reject) => {

        if(sectionCache.section){
            return resolve($.extend(true,{}, sectionCache));
        }
        getParentShowID().then((userInfo) => {
            let rootParentShowID;

            try{
                rootParentShowID = userInfo.user.companyShowID;
            }catch(err){
                rootParentShowID = userInfo;
            }


            Promise.all([getSection(), getPerson()])
                .then(([section=[], person=[]]) => {

                    const addUniqueId = (item)=> {
                        item.uniqueID = item.D_NAME + '_' + (item.id || item.SHOW_ID);
                    };

                    addRootSection(section, "明天你好",rootParentShowID);
                    section = combineSectionPerson(toTreeData(section, 'SHOW_ID', 'D_PARENTID_SHOW_ID',addUniqueId, 0), person, addUniqueId);

                    sectionCache.section = $.extend(true, [], section);
                    sectionCache.person = $.extend(true, [], person);
                    resolve({section, person});
                })

                .catch((err) => {

                    reject(err);
                });
        }).catch((err) => (console.log(err)));
    });



}

